import styled from 'styled-components';
import { List } from '@material-ui/core';

const NavList = styled(List)`
  &&& {
    padding-left: 30px !important;
    color: rgba(0, 0, 0, 0.7);
  }
`;

export const Styled = {
  NavList,
};
